   private static void HexArrayToBinary(byte[] hexArray) {
      String total = "";
      PacketDecoder pd = new PacketDecoder(new ByteArrayByteStream(hexArray));

      while (pd.available() > 0L) {
         byte temp1 = pd.readByte();
         String binHex = Integer.toBinaryString(temp1);

         while (binHex.length() < 8) {
            binHex = "0" + binHex;
         }

         while (binHex.length() > 8) {
            binHex = binHex.substring(1);
         }

         total = binHex + total;
      }

      StringBuffer sb = new StringBuffer(total);
      String reverse = sb.reverse().toString();
      System.out.println(reverse);
   }

